<section id="mann-whitney-test" class="level3">
<h3 class="anchored" data-anchor-id="mann-whitney-test">Mann-Whitney test</h3>
<p>As the normality assumption is not met the courses, we will use the Mann-Whitney test to compare the scores of the RNPQ questionnaire between the couses.</p>
