<section id="kruksal-wallis-test" class="level3">
<h3 class="anchored" data-anchor-id="kruksal-wallis-test">Kruksal-Wallis test</h3>
<p>As the normality assumption is not met in some groups, we will use the Kruksal-Wallis test to compare the scores of the RNPQ questionnaire among the Degree-Course groups .</p>
