<li>First course of Nursing and last course of Physiotherapy (p-value &lt; 0.01).</li>
<li>Last course of Nursing and last course of Physiotherapy (p-value &lt; 0.01).- First course of Medicine and first course of Nursing (p-value &lt; 0.01).</li>
<li>First course of Medicine and last course of Medicine (p-value &lt; 0.01).</li>
<li>First course of Medicine and first course of Physiotherapy (p-value &lt; 0.05).</li>
</ul>
</section>
<section id="two-factors-anova-for-ranks" class="level3">
<h3 class="anchored" data-anchor-id="two-factors-anova-for-ranks">Two factors ANOVA for ranks</h3>
<p>As the Kruskal-Wallis test can not be used for two factors, we can not study the interaction between the degree and the course. However, we can use the two factors ANOVA for ranks to study the effect of the degree and the course on the scores of the RNPQ questionnaire, and the interaction between the degree and the course.</p>
<div class="cell">
<div class="sourceCode cell-code" id="cb31"><pre class="sourceCode r code-with-copy"><code class="sourceCode r"><span id="cb31-1"><a href="#cb31-1" aria-hidden="true" tabindex="-1"></a>anova_ranks <span class="ot">&lt;-</span> <span class="fu">aov</span>(<span class="fu">rank</span>(RNPQ) <span class="sc">~</span> Degree <span class="sc">*</span> Course, <span class="at">data =</span> df)</span>
<span id="cb31-2"><a href="#cb31-2" aria-hidden="true" tabindex="-1"></a><span class="co"># Use the type III sum of squares as the groups are unbalanced.</span></span>
<span id="cb31-3"><a href="#cb31-3" aria-hidden="true" tabindex="-1"></a><span class="fu">Anova</span>(anova_ranks, <span class="at">type =</span> <span class="st">&quot;III&quot;</span>) <span class="sc">|&gt;</span></span>
<span id="cb31-4"><a href="#cb31-4" aria-hidden="true" tabindex="-1"></a>    <span class="fu">tidy</span>() <span class="sc">|&gt;</span></span>
<span id="cb31-5"><a href="#cb31-5" aria-hidden="true" tabindex="-1"></a>    <span class="fu">kable</span>()</span></code><button title="Copy to Clipboard" class="code-copy-button"><i class="bi"></i></button></pre></div>
<div class="cell-output-display">
<table class="table table-sm table-striped small">
<thead>
