<th style="text-align: right;">sumsq</th>
<th style="text-align: right;">df</th>
<th style="text-align: right;">statistic</th>
<th style="text-align: right;">p.value</th>
</tr>
</thead>
<tbody>
<tr class="odd">
<td style="text-align: left;">(Intercept)</td>
<td style="text-align: right;">258233.8</td>
<td style="text-align: right;">1</td>
<td style="text-align: right;">24.625322</td>
<td style="text-align: right;">0.0000010</td>
</tr>
<tr class="even">
<td style="text-align: left;">Degree</td>
<td style="text-align: right;">163389.5</td>
<td style="text-align: right;">3</td>
<td style="text-align: right;">5.193638</td>
