<p>The two factors ANOVA for ranks shows both, the degree and the course, have a statistically significant effect on the scores of the RNPQ questionnaire, and also the interaction between the degree and the course has a statistically significant effect (p-value &lt; 0.05).</p>
</section>
<section id="post-hoc-test-1" class="level3">
