<span id="cb32-2"><a href="#cb32-2" aria-hidden="true" tabindex="-1"></a><span class="fu">emmeans</span>(anova_ranks, <span class="sc">~</span> Course <span class="sc">|</span> Degree) <span class="sc">|&gt;</span> </span>
<span id="cb32-3"><a href="#cb32-3" aria-hidden="true" tabindex="-1"></a>    <span class="fu">pairs</span>() <span class="sc">|&gt;</span> </span>
