<p>For the comparison among degrees, there are statistically significant differences between:</p>
<ul>
<li>Nursing and Physiotherapy (p-value &lt; 0.01). The mean of Physiotherapy is between 4.22 and 9.74 points smaller.</li>
<li>Nursing and Medicine (p-value &lt; 0.05). The mean of Medicine is between 0.38 and 9.1 points smaller.</li>
</ul>
<p>For the comparison between courses, there is a statistically significant difference between the first and the fourth course (p-value &lt; 0.01). The mean of the fourth course is between 3.92 and 7.66 points smaller.</p>
<p>For the comparison among degree-course groups, there are statistically significant differences between:</p>
<ul>
<li>First course of Nursing and last course of Physiotherapy (p-value &lt; 0.01). The mean of the last course of Physiotherapy is between 7.97 and 16.47 points smaller.</li>
<li>First course of Physiotherapy and last course of Physiotherapy (p-value &lt; 0.01). The mean of the last course of Physiotherapy is between 4.92 and 12.22 points smaller.</li>
<li>Last course of Nursing and last course of Physiotherapy (p-value &lt; 0.01). The mean of the last course of Physiotherapy is between 5.86 and 18.08 points smaller.</li>
<li>First course of Medicine and last course of Physiotherapy (p-value &lt; 0.01). The mean of the last course of Physiotherapy is between 2.15 and 14.77 points smaller.</li>
</ul>
<p>There are no statistically significant differences between the other groups, in particular, between the means of the first and last courses of Nursing, Pharmacy and Medicine.</p>
